 pragma solidity ^0.4.17;

contract Rating {
    struct Movie {
        string name;
        uint rating;
    }

    Movie[] public movies;
  function Rating(){
    movies.push(Movie("Titanic",4));
    movies.push(Movie("SS",5));
  }


    function addMovie(string movie) public{
      movies.push(Movie(movie,4)); 
  }
  function getMovies() public returns(string){
    for(uint i=0;i<movies.length;i++){
     return movies[i].name;
    }
  }

}
